import React from 'react';
import './App.css';
import TodoList from "./app/Containers/TodoList/TodoList";
import Header from "./app/Components/Header/Header"
import Input from '@material-ui/core/Input';
import Card from '@material-ui/core/Card';
import AddIcon from '@material-ui/icons/Add';



function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/*todo place your todo header here */}
        <Header />
      </header>
      <section>
      <Card className="allTodo">
        <div>
        <Input className="allTodoInput" placeholder="Введите новое задание" inputProps={{ 'aria-label': 'description' }} />
        <AddIcon />
        </div>
        {/* <TodoList /> */}
      </Card>
      </section>
    </div>
  );
}

export default App;
